  false,\n\t\"url\": null,\n\t\"notes\": \"This is the Fire Danger Operating and Preparedness
  Plan for the Burns Interagency Fire Zone.  This plan provides a method to calculate
  the preparedness and dispatch levels and provides guidelines for actions taken with
  specific preparedness levels.  This plan will help simplify the decision making
  process for Agency administrators, fire managers, dispatchers, agency cooperators
  and firefighters by setting planning and dispatch levels using break points (based
  on past fire history and weather).  The use of other factors including coordination
  with cooperators, other interagency partners, resource commitment, drought, fuel
  load and large or multiple fire activity must be considered in the decision making
  process in the final determination of the daily preparedness and dispatch levels.
  \ Objectives, responsibilities, operational procedures, fire danger rating, and
  dispatching are discussed in this plan.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
